(function ($) {
    window.ParsleyValidator.addValidator('equaltoinsensitive',
                           function (value, requirement) {
                               try {
                                   return value.toLowerCase() === $(requirement).val().toLowerCase();
                               } catch (e) {
                                   return true;
                               }
                           }, 32)
                    .addMessage('en', 'equaltoinsensitive', 'This value should be the same.');
    window.ParsleyValidator.addValidator('notequaltoinsensitive',
                           function (value, requirement) {
                               try {
                                   return value.toLowerCase() !== $(requirement).val().toLowerCase();
                               } catch (e) {
                                   return true;
                               }
                           }, 32)
                    .addMessage('en', 'notequaltoinsensitive', 'This value should not be the same.');
}(jQuery));

$(function () {
    window.ParsleyValidator
    .addValidator('minimumage', function (value, requirement) {

        function isLeapYear(year) {
            var d = new Date(year, 1, 28);
            d.setDate(d.getDate() + 1);
            return d.getMonth() == 1;
        }

        function getAge(date) {
            var d = new Date(date),
                now = new Date();
            var years = now.getFullYear() - d.getFullYear();
            d.setFullYear(d.getFullYear() + years);
            if (d > now) {
                years--;
                d.setFullYear(d.getFullYear() - 1);
            }
            var days = (now.getTime() - d.getTime()) / (3600 * 24 * 1000);
            return years + days / (isLeapYear(now.getFullYear()) ? 366 : 365);
        }

        age = Math.floor(getAge(value))

        return age >= requirement;


    }, 32)
    .addMessage('en', 'minimumage', 'Please enter a valid birthday.')
});

