window.ParsleyConfig = {
    validators: {
        notEqual: {
            fn: function (val, elem) {
                "use strict";
                return val !== $(elem).val()
            }
        },
        birthDate: {
            fn: function (val) {
                "use strict";
                var valid = !0,
                    pickerMoment = moment(val, "MM/DD/YYYY"),
                    now = moment(Date.now()),
                    birthdayAdjust = pickerMoment.add(18, "y").add(1, "seconds");
                return birthdayAdjust.diff(now, "s") > 0 && (valid = !1), valid
            }
        }
    }
}

