var objectCookie = (function () {
    "use strict";

    var removeCookie = function (name) {
        document.cookie = encodeURIComponent(name) +
            "=; Path=/; Expires=Thu, 01 Jan 1970 00:00:00 GMT;";
    };

    var removeCookieWithPath = function (name, path) {
        document.cookie = encodeURIComponent(name) +
            "=; expires=Thu, 01 Jan 1970 00:00:00 GMT;path=" + path;
    };

    var setCookie = function (domain, name, value, exdays) {
        var d = new Date();
        d.setTime(d.getTime() + 24 * exdays * 60 * 60 * 1e3);
        var expires = "expires=" + d.toUTCString();
        document.cookie = name + "=" + value + "; " + expires + "; path=/;secure";
    }

    var getCookie = function (cname) {
        var name = cname + "=";
        var ca = document.cookie.split(';');
        for (var i = 0; i < ca.length; i++) {
            var c = ca[i];
            while (c.charAt(0) === ' ') {
                c = c.substring(1);
            }
            if (c.indexOf(name) === 0) {
                return c.substring(name.length, c.length);
            }
        }
        return "";
    }

    return {
        removeCookie: removeCookie,
        removeCookieWithPath: removeCookieWithPath,
        setCookie: setCookie,
        getCookie: getCookie
    }
})();;
$(function () {
    if (document.querySelector('#ie-advice-modal')) {
        if (!!window.MSInputMethodContext && !!document.documentMode) {
            // Is IE11

            var ie11Cookie = objectCookie.getCookie('CE_IE11');

            if (ie11Cookie === "") {
                $('#ie-advice-modal').modal();
                objectCookie.setCookie('', 'CE_IE11', '1', 30 * 3);
            }
        }
    }

    updateScrollPosition();

    // To fix twoColumn1-1 component without left/right padding (mobile)
    if ($(window).width() < 768) {
        var attrPadding = $('.row_with-padding').css('padding');
        if (attrPadding === "0px") {
            $('.row_with-padding').css('padding-left', '15px');
            $('.row_with-padding').css('padding-right', '15px');
        }
    }

    //to hide the empty ContentWithRightRail component
    if ($('.lyt-l3-template-a').length > 0) {
        if ($('.lyt-l3-template-a').html().trim().length === 0) {
            if ($('.wp-template-sidebar').children().html().trim().length === 0) {
                $('.withsidebar').parent()[0].style.display = "none";
            }
        }
    }

    if ($("#redirectTime").length > 0) {
        var secondsToRedirect404Page = $("#SecondsToRedirect404Page").val();
        if (!secondsToRedirect404Page) {
            secondsToRedirect404Page = 5;
        }
        updateTimerAndRedirect(secondsToRedirect404Page);
    }

    // first press of the tab key selects the accessibility button, and the second one selects username input
    function setTabIndexs() {
        $("#usntA40Link").ready(function () {
            var n = $("#userNameLoginBlock").length ? 2 : 1;
            $("[tabindex]").each(function () {
                var tabIndex = $(this).attr("tabindex");
                if (tabIndex != "-1" && tabIndex != "") {
                    $(this).attr("tabindex", parseInt($(this).attr("tabindex")) + n);
                }
            });
            $("#usntA40Link").attr("tabindex", "1");
            $("#userNameLoginBlock").attr("tabindex", "2");
        });
    }
    setTabIndexs();
    var tabIndexInterval = setInterval(function () {
        if ($("#usntA40Link").length != 0 && $("#usntA40Link").attr("tabindex") != "1") {
            setTabIndexs();
        }
    }, 300);
    setTimeout(function () {
        clearInterval(tabIndexInterval);
    }, 7000);
});

// Check header height and pass to the anchor to avoid bug #53790
function updateScrollPosition() {
    var anchor = document.querySelector(':target');

    if (anchor !== null) {
        var header = document.querySelector('header.fixed-nav'),
            topHeader = document.querySelector('header.fixed-nav > div:not(header-messaging):nth-child(2)'),
            alert = document.querySelector('#weatherAlertBarDiv');

        var value = 15 + (alert.offsetHeight < 56 ? header.offsetHeight : topHeader.offsetHeight + alert.offsetHeight),
            scrollY = $(anchor).offset().top - value;

        switch (anchor.id) {
            case 'accountNoticesAccordion':
                var accordionHeader = anchor.previousElementSibling;
                scrollY -= accordionHeader ? accordionHeader.offsetHeight - 15 : 0;
                break;

            default:
                break;
        }

        window.scrollTo(0, scrollY);
    }
}

function updateTimerAndRedirect(counter) {
    if (counter > 0) {
        setTimeout(function () {
            counter = counter - 1;
            $("#redirectTime").text("0" + counter);
            updateTimerAndRedirect(counter);
        }, 1000);
    } else {
        window.location.href = "/";
    }
}
