function idNav() {
    var currentNav = '';
    if (navigator.userAgent.search("MSIE") >= 0) {
        currentNav = "MSIE";
    }
    if (navigator.userAgent.search("Chrome") >= 0) {
        currentNav = "Chrome";
    }
    if (navigator.userAgent.search("Firefox") >= 0) {
        currentNav = "Firefox";
    }
    if (navigator.userAgent.search("Safari") >= 0 && navigator.userAgent.search("Chrome") < 0) {
        currentNav = "Safari";
    }
    if (navigator.userAgent.search("Opera") >= 0) {
        currentNav = "Opera";
    }
    if (navigator.userAgent.search("Edge") >= 0) {
        currentNav = "Edge";
    }
    return currentNav;
}
function idMobile() {
    var currentDevice;
    if (navigator.userAgent.search("Mobi") >= 0) {
        var $window = $(window);
        var windowSize = $window.width();
        if (windowSize > 767 || windowSize < 991) {
            currentDevice = "Tablet";
        } else {
            currentDevice = "Mobile";
        }
    } else {
        currentDevice = "Desktop";
    }
    return currentDevice;
};;
$(document).ready(function () {
    var Authenticated = $("body").data("authenticated");
    var Server = $("body").data("server");
    var ActiveServer = $("body").data("active");
    var pageNormal = $("body").data("page-normal");
    var servicetype = $("body").data("fueltype");
    var planName = $("body").data("plan-name");

    if (pageNormal) {
        var isKmliEnabled = !!objectCookie.getCookie("ln");
        if (ActiveServer == "1") {
            dataLayer.push({
                'cookieVar': '{}',
                'experimentType': Server + ' TEST',
                'browserType': idNav(),
                'referralUrl': '{}',
                'loggedIn': Authenticated,
                'kmliStatus': isKmliEnabled,
                'deviceType': idMobile(),
                'fuelType': servicetype,
                'planName': planName
            });
        } else {
            dataLayer.push({
                'cookieVar': '{}',
                'browserType': idNav(),
                'referralUrl': '{}',
                'loggedIn': Authenticated,
                'kmliStatus': isKmliEnabled,
                'deviceType': idMobile(),
                'fuelType': servicetype,
                'planName': planName
            });
        }
    }

    var jtmbutton = document.getElementsByClassName('btn btn-lg btn-default')[0];
    if (jtmbutton != null && jtmbutton != 'undefined' && jtmbutton.value == "Join the Movement")
    {
        att_tag = document.createAttribute("data-tag");
        att_category = document.createAttribute("data_category");
        att_label = document.createAttribute("data_label");
        if (ActiveServer == "1") {
            att_tag.value = "Clean Energy Conversion " + Server;
        }
        att_category.value = "Conversion";
        att_label.value = "Clean Energy Enrollment";

        jtmbutton.setAttributeNode(att_tag);
        jtmbutton.setAttributeNode(att_category);
        jtmbutton.setAttributeNode(att_label);

        jtmbutton.setAttribute('class', 'btn btn-lg btn-default event-ga-tag');
    }

    $(".inner-anchor").removeAttr("href");

    $(".event-icon-banner").click(function (e) {
        var link = (this).getAttribute("data-link");
        var tag = (this).getAttribute("data-tag");
        var category = (this).getAttribute("data-category");
        var label = (this).getAttribute("data-label");
        var blank = (this).getAttribute("data-blank").toLowerCase() === 'true';
        iconBannerRedirect(e, link, tag, category, label, blank);
    });

    $(".image-rollover-event").click(function (e) {
        var tag = (this).getAttribute("data-tag");
        var category = (this).getAttribute("data-category");
        var label = (this).getAttribute("data-label");
        if ($(this).data("target") == "_blank") {
            // opens new tab and refreshes page to send analytics
            window.open($(this).data("href"));
            e.stopImmediatePropagation();
            e.preventDefault();
            if (tag && category && label) {
                sendAnalytics(tag, category, label);
                document.location.reload();
            }
        } else {
            // just redirects
            if (tag && category && label) {
                sendAnalytics(tag, category, label);
            }
            window.location = $(this).data("href");
            e.stopImmediatePropagation();
        }
    });

    $(".event-ga-select-option").change(function () {
        PushEventGaTag($("option:selected", this));
    });
    infoCardAnalytics()
})

function iconBannerRedirect(e, link, actionText, categoryText, labelText, targetBlank) {      // bug 172266
    if (!e || !link) return;
    var sendingAnalytics = actionText && categoryText && labelText;
    if (sendingAnalytics) sendAnalytics(actionText, categoryText, labelText);
    if (targetBlank) {
        // click on div opens new tab and refreshes page to send analytics
        window.open(link);
        e.stopImmediatePropagation();
        e.preventDefault();
        if (sendingAnalytics) document.location.reload();
    } else {
        // click on inner anchor just redirects
        window.location = link;
        e.stopImmediatePropagation();
    }
};

function sendAnalytics(code, category, label) {        // bug 172266
    var pageNormal = $("body").data("page-normal");
    if (pageNormal) {
        var Server = $("body").data("server");
        var ActiveServer = $("body").data("active");
        if (ActiveServer == "1") {
            code = code + " " + Server;
        }
        if (code && category && label) {
            if (dataLayer.length > 0 && code.length > 0 && category.length > 0 && label.length > 0) {
                dataLayer.push({
                    'event': 'eventTracking',
                    'category': category,
                    'action': code,
                    'label': label
                });
            }
        }
    }
};

$(function () {
    $("body").on("click", ".event-ga-tag",
        function (event) {
            var pageNormal = $("body").data("page-normal");

            if (pageNormal) {
                var Server = $("body").data("server");
                var ActiveServer = $("body").data("active");
                var code = $(this).data("tag");
                if (ActiveServer == "1") {
                    code = code + " " + Server;
                }
                var category = $(this).data("category");
                var label = $(this).data("label");

                if (code && category && label) {
                    if (dataLayer.length > 0 && code.length > 0 && category.length > 0 && label.length > 0) {
                        dataLayer.push({
                            'event': 'eventTracking',
                            'category': category,
                            'action': code,
                            'label': label
                        });
                    }
                }
            }
        });

    $("body").on("click", ".event-ga-tag-dropdown-item",
        function () {
            PushEventGaTagParms($(this).data("ga-category"), $(this).data("ga-tag"), $(this).data("ga-label"));
        });

    $("body").on("click", ".event-ga-tag-checkbox",
        function () {
            var statusSuffix = '';

            if ($(this).attr('type') == 'checkbox') {
                statusSuffix = $(this).is(':checked') ? ' Checked' : ' Unchecked';
            }

            PushEventGaTagParms($(this).data("category"), $(this).data("tag") + statusSuffix, $(this).data("label") + statusSuffix);
        });
});

function PushEventGaTag(element) {
    PushEventGaTagParms(element.data("category"), element.data("tag"), element.data("label"));
}

function PushEventGaTagParms(category, action, label) {
    if ($("body").data("page-normal")) {
        if ($("body").data("active") == "1") {
            action = action + " " + $("body").data("server");
        }
        if (dataLayer.length > 0 && category && action && label && category.length > 0 && action.length > 0 && label.length > 0) {
            dataLayer.push({
                'event': 'eventTracking',
                'category': category,
                'action': action,
                'label': label
            });
        }
    }
}

function LoadEventGaTagMainNavMenu() {
    // tagging for tracking Main Nav click interaction:
    if (!$("nav.main-nav.header-2017").hasClass("menu-hover")) {
    $("body").on("click", ".event-ga-tag-main-nav",
        function () {
            PushEventGaTagParms($(this).data("category"), $(this).data("tag"), $(this).data("label"));
        });
    };
    // tagging for tracking Main Nav hover interaction:
    if ($("nav.main-nav.header-2017").hasClass("menu-hover")) {
        $("a.dropdown-toggle.event-ga-tag-main-nav.menu-hover").hover(
            function () {
                // only track when hover in
                PushEventGaTagParms($(this).data("category"), $(this).data("tag"), $(this).data("label"));
            }, function (e) {
                // don't track hover out
            });
    };
};

function filteringComponentAnalytics(element) {
    var pageNormal = $("body").data("page-normal");

    if (pageNormal) {
        var Server = $("body").data("server");
        var ActiveServer = $("body").data("active");
        var code = $(element).data("tag");
        if (ActiveServer == "1") {
            code = code + " " + Server;
        }
        var category = $(element).data("category");
        var label = $(element).data("label");

        if (code && category && label) {
            if (dataLayer.length > 0 && code.length > 0 && category.length > 0 && label.length > 0) {
                dataLayer.push({
                    'event': 'eventTracking',
                    'category': category,
                    'action': code,
                    'label': label
                });
            }
        }
    }
}
